class Solution(object):
    def minIncrementForUnique(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        nums.sort()
        counter = 1
        added_ones = 0

        while counter < len(nums):
            cur_num = nums[counter]
            last_num = nums[counter - 1]
            if last_num >= cur_num:
                ones = last_num - cur_num + 1
                nums[counter] += ones
                added_ones += ones
            counter += 1
        return added_ones


